import React from 'react';
import DisputeDetail from './DisputeDetail'

class Dispute extends React.Component {

constructor(props){
  super(props)
  console.log(props)
}

disputeStatusToString = (code) => {
  switch (code) {
    case "0":
      return "Waiting"
      break;
    case "1":
      return "Appealable"
      break;
    case "2":
      return "Solved"
      break;

    default:
      return ""+code
  }

}

  render(){
    return (
        <div>
          <tr data-toggle="collapse" data-target={'#accordion + this.props.id'} class="clickable">
              <td>Some Stuff</td>
              <td>Some more stuff</td>
              <td>And some more</td>
          </tr>
          <tr>
              <td colspan="3">
                  <div id={'accordion + this.props.id'} class="collapse">Hidden by default</div>
              </td>
          </tr>
        </div>
    )
  }
}

export default Dispute
